import React from "react";
import { Col, Container, Row } from "react-bootstrap";


const Admin = () =>{
    return (
        <Container>
            <Row>
                <Col md={9}>
                <OrderList/>
                </Col>
            </Row>
        </Container>
    );
};

export default Admin;
